import React from 'react';

const AboutUs = () => {
    return (
        <div className="container">
            <h1>About Us</h1>
            <p>
                Welcome to SendTextAnywhere! We are dedicated to providing seamless communication
                solutions that connect you with your loved ones, colleagues, and clients wherever 
                they are. Our mission is to make texting easy, efficient, and accessible to everyone.
            </p>
            <p>
                Our team of experts is constantly working on enhancing our platform to ensure that 
                you have the best experience possible. Thank you for choosing us!
            </p>
        </div>
    );
};

export default AboutUs;
